Korábbi összefoglaló videókban már hallottam pár szintén rejtélyes egybeesést:
- ez idő tájt más eltűnések és halálesetek is történtek a környéken, köztük egy lányé, aki közel egy idős volt velük;
-  két fiatalember, akikkel a lányok állítólag a panamai út során ismerkedtek meg - az egyikük vezetékneve Valenzuela - szintén rövid időn belül meghaltak a lányok eltűnése után;
- időközben előkerült egy kép, amin állítólag a két lány és a két fiú látható egy sziklás, folyós területen. Elméletek szerint a fotót a taxis is készíthette négyükről: amennyiben tényleg ők láthatók ezen a képen, akkor már 5 haláleset is köthető az ügyhöz. A kép távoli készítése és rossz minősége nehezíti az azonosítást, de hasonlítanak rájuk;
- a csontok vizsgálata során - amellett, hogy nem találtak fog és karomnyomokat - kimutattak olyan anyagot a csontokon, ami a csontok megtisztítására utalt;
- a fényképezőgép vizsgálata során kiderült, hogy az 509-es kép utólag lett törölve, nem egyből. Amennyiben hibás lett volna a kép, és rögtön törlik, az új kép átvette volna a helyét, de a törlés az 510-es kép készítése után történt.
